import React from 'react';

function FoodItem({ food, onRemove, onUpdateQuantity }) {
  return (
    <li>
      <span>{food.name}</span>
      <span>{food.calories} calories</span>
      <input
        type="number"
        value={food.quantity}
        onChange={(e) => onUpdateQuantity(parseInt(e.target.value))}
      />
      <button onClick={onRemove}>Remove</button>
    </li>
  );
}

export default FoodItem;
